INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('3', 'Mix đồ Jean thế nào đẹp, fashionable?', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Dường như Jean l&agrave; chất liệu chưa bao giờ l&agrave;m ngừng lại những &yacute; tưởng thiết kế độc đ&aacute;o v&agrave; mới lạ. Quần Jean tuy l&agrave; kiểu quần đơn giản v&agrave; cổ điển nhất nhưng m&oacute;n đồ n&agrave;y lại kh&ocirc;ng hề g&acirc;y sự nh&agrave;m ch&aacute;n v&agrave; cũng kh&ocirc;ng bị l&atilde;ng qu&ecirc;n khi trong l&agrave;ng thời trang c&oacute; v&ocirc; v&agrave;n những style mới lạ. Diện quần Jeans vừa c&aacute; t&iacute;nh vừa trẻ trung v&agrave; kh&aacute; thoải m&aacute;i trong những hoạt động ng&agrave;y h&egrave;, bởi thế m&agrave; chiếc quần n&agrave;y li&ecirc;n tục so&aacute;n ng&ocirc;i trong &ldquo;bảng xếp hạng&rdquo; những m&oacute;n đồ được ưa th&iacute;ch qua mỗi năm.</span></p>\r\n', '1', 'upload/img/news/t3.jpg', '<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>1/ C&aacute;ch phối quần jeans r&aacute;ch c&aacute; t&iacute;nh</strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><strong><img src=\"http://bizweb.dktcdn.net/100/296/275/files/30.jpg?v=1522205493734\" style=\"width:70%\" /></strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:14px\">Quần jeans r&aacute;ch mang đến cho bạn một ch&uacute;t bụi phủi, ph&aacute; c&aacute;ch. Trang phục chuẩn nhất để kết hợp với quần jeans r&aacute;ch đ&oacute; l&agrave; &aacute;o ph&ocirc;ng v&agrave; &aacute;o vest d&aacute;ng xu&ocirc;ng. Bạn c&oacute; thể mặc jeans r&aacute;ch d&aacute;ng &ocirc;m s&aacute;t hoặc kiểu hơi rộng, ống đứng.Với thời trang jeans r&aacute;ch, bạn c&oacute; thể kết hợp theo phong c&aacute;ch khỏe khoắn hoặc gợi cảm đều c&oacute; thể được</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>2/ Mix đồ với quần jeans loang</strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:14px\">Jeans loang đang l&agrave; phong c&aacute;ch thời trang nổi bật nhất với c&aacute;c mẫu quần jeans. Tuy nhi&ecirc;n để mặc jeans loang đẹp đ&ograve;i hỏi bạn phải biết phối t&ocirc;ng m&agrave;u quần jeans chuẩn v&agrave; h&agrave;i h&ograve;a. Bạn n&ecirc;n chọn c&aacute;c t&ocirc;ng m&agrave;u &aacute;o tương đồng với m&agrave;u quần jeans, tr&aacute;nh những m&agrave;u đối chọi sẽ rất phản cảm khi kết hợp.<br />\r\nC&aacute;c t&ocirc;ng m&agrave;u đen, ghi, xanh, trắng được khuy&ecirc;n n&ecirc;n kết hợp khi mặc quần jeans loang. Điều n&agrave;y kh&ocirc;ng c&oacute; nghĩa l&agrave; bạn phải bỏ qua những chiếc &aacute;o c&oacute; gam m&agrave;u ấm n&oacute;ng, chỉ cần tinh tế phối c&ugrave;ng t&ocirc;ng với phụ kiện như t&uacute;i x&aacute;ch hoặc gi&agrave;y, bạn ho&agrave;n to&agrave;n c&oacute; thể kết hợp jeans loang với m&agrave;u sắc sặc sỡ.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>3/ Phối đồ với quần jeans skinny</strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><strong><img src=\"http://bizweb.dktcdn.net/100/296/275/files/21a-64a1f57b-4d3e-4cd2-b834-cc952aadef17.jpg?v=1522205533199\" style=\"width:70%\" /></strong></span></p>\r\n\r\n<p style=\"text-align:justify\"><br />\r\n<span style=\"font-size:14px\">Quần jeans g&acirc;n nổi kết hợp chất liệu jeans Skinny khiến cho th&acirc;n h&igrave;nh bạn thật thon thả, gọn g&agrave;ng v&agrave; đ&ocirc;i ch&acirc;n bỗng d&agrave;i như v&ocirc; tận.<br />\r\nBạn h&atilde;y diện kiểu quần n&agrave;y với những chiếc &aacute;o điệu đ&agrave;, nữ t&iacute;nh, c&oacute; thể hơi gợi cảm một ch&uacute;t với những đường cắt xẻ khoe kh&eacute;o th&acirc;n h&igrave;nh gợi cảm, kết hợp c&ugrave;ng một đ&ocirc;i gi&agrave;y &ocirc;m cổ ch&acirc;n, trang phục t&ocirc;n d&aacute;ng cao sẽ khiến bạn trở n&ecirc;n tự tin v&agrave; nổi bật.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>4/ Mix quần jeans với &aacute;o cho&agrave;ng d&agrave;i</strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><strong><img src=\"http://bizweb.dktcdn.net/100/296/275/files/26.jpg?v=1522205571442\" style=\"width:70%\" /></strong></span></p>\r\n\r\n<p style=\"text-align:center\"><br />\r\n<span style=\"font-size:14px\">Phong c&aacute;ch thời trang n&agrave;y được nhiều bạn trẻ ưu ti&ecirc;n lựa chọn trong những ng&agrave;y đ&ocirc;ng gi&aacute; r&eacute;t. Sự khỏe khoắn của quần jeans kết hợp với vẻ dịu d&agrave;ng của &aacute;o cho&agrave;ng d&agrave;i khiến bạn trẻ trung, năng động hơn rất nhiều.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>5/ Chọn quần jeans mặc với &aacute;o len trong m&ugrave;a đ&ocirc;ng</strong></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><strong><img src=\"http://bizweb.dktcdn.net/100/296/275/files/27.jpg?v=1522205591491\" style=\"width:70%\" /></strong></span></p>\r\n\r\n<p style=\"text-align:center\"><br />\r\n<span style=\"font-size:14px\">Tất nhi&ecirc;n, quần jeans với &aacute;o len lu&ocirc;n l&agrave; cặp bạn th&acirc;n thiết của thời trang m&ugrave;a đ&ocirc;ng. Nhanh, gọn, năng động, trẻ trung l&agrave; những g&igrave; ch&uacute;ng mang đến cho phụ nữ. D&ugrave; thời trang c&oacute; xoay vần đến đ&acirc;u th&igrave; việc mặc quần jeans với &aacute;o len lu&ocirc;n l&agrave; một &ldquo;th&uacute; vui&rdquo; của nhiều c&ocirc; g&aacute;i. C&aacute;ch chọn m&agrave;u trang phục theo m&agrave;u da, độ tuổi</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>C&aacute;ch chọn quần jean theo d&aacute;ng người cực chuẩn</strong><br />\r\nChiếc quần jeans l&agrave; item cơ bản thường thấy trong tủ đồ của chị em. &nbsp;Đ&acirc;y l&agrave; m&oacute;n đồ cơ bản được ph&aacute;i đẹp ưa chuộng bởi dễ kiếm, dễ phối đồ v&agrave; cũng dễ bảo quản. Ch&iacute;nh v&igrave; n&oacute; l&agrave; m&oacute;n đồ quen thuộc n&ecirc;n &iacute;t chị em để &yacute; để chọn đượcc cho m&igrave;nh một chiếc quần t&ocirc;n v&oacute;c d&aacute;ng v&agrave; đường cong của cơ thể. C&ugrave;ng t&igrave;m hiểu về v&oacute;c d&aacute;ng bạn v&agrave; mẹo chọn được chiếc quần ph&ugrave; hợp nh&eacute;!</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">D&aacute;ng đồng hồ c&aacute;t: D&aacute;ng người đồng hồ c&aacute;t thường c&oacute; những đường cong đầy đặn, ch&iacute;nh v&igrave; vậy, những chiếc quần jeans c&oacute; tone m&agrave;u đều s&aacute;ng hoặc đều tối sẽ l&agrave; lựa chọn tối ưu. Việc lựa chọn m&agrave;u sắc như vậy sẽ gi&uacute;p bạn che giấu những điểm &ldquo;tr&ograve;n trịa&rdquo; tr&ecirc;n cơ thể gi&uacute;p bạn tr&ocirc;ng mảnh mai hơn. Với những chiếc quần jean qu&aacute; d&agrave;i, bạn c&oacute; thể xắn ống l&ecirc;n để tỉ l&ecirc;n cơ thể được c&acirc;n bằng giữa h&ocirc;ng v&agrave; v&ograve;ng 3 của m&igrave;nh. Với những chiếc quần d&aacute;ng ngắn (crop style) bạn n&ecirc;n chọn cho m&igrave;nh những đ&ocirc;i gi&agrave;y nổi bật với thiết kế độc đ&aacute;o sẽ cực k&igrave; ấn tượng.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">D&aacute;ng người quả chuối v&agrave; quả t&aacute;o D&aacute;ng người quả t&aacute;o c&oacute; phần th&acirc;n tr&ecirc;n to hơn phần th&acirc;n dưới, trong khi d&aacute;ng người quả chuối c&oacute; cấu tr&uacute;c phần h&ocirc;ng, ngực, bụng gần như tương đương nhau. Hai cấu tr&uacute;c người n&agrave;y c&oacute; điểm chung l&agrave; phần m&ocirc;ng thường l&eacute;p, dẹt. Bởi vậy, cả 2 d&aacute;ng người n&agrave;y kh&aacute; kh&oacute; chọn quần, đặc biệt l&agrave; quần jeans. Nếu bạn thuộc một trong hai d&aacute;ng kh&aacute; &ldquo;kh&oacute; nhằn&rdquo; n&agrave;y bạn n&ecirc;n chọn kiểu quần jeans thụng, quần b&ograve; d&aacute;ng palazzo ống rộng với điểm nhấn t&uacute;i phần sau m&ocirc;ng v&agrave; h&ocirc;ng để che được khuyết điểm của m&igrave;nh.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">D&aacute;ng người quả l&ecirc; D&aacute;ng người quả l&ecirc; c&oacute; th&acirc;n h&igrave;nh &ldquo;tr&ecirc;n nhỏ dưới to&rdquo; n&ecirc;n chọn quần boyfriend quần b&ograve; cạp cao hay quần jeans &ocirc;m kh&ocirc;ng t&uacute;i để giảm cảm gi&aacute;c nặng nề cho v&ograve;ng 3. Th&ecirc;m v&agrave;o đ&oacute;, kh&eacute;o chọn một chiếc &aacute;o tay rộng sẽ gi&uacute;p bạn c&acirc;n bằng được phần th&acirc;n tr&ecirc;n v&agrave; th&acirc;n dưới của cơ thể.</span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">D&aacute;ng thấp b&eacute;: Những c&ocirc; n&agrave;ng d&aacute;ng thấp b&eacute; (petite) h&atilde;y kh&eacute;o l&eacute;o &ldquo;tr&aacute;nh xa&rdquo; những chiếc quần skinny &ocirc;m s&aacute;t ch&acirc;n bởi ch&uacute;ng sẽ l&agrave;m những khuyết điểm của bạn nổi bật hơn. Thay v&agrave;o đ&oacute; những chiếc quần d&aacute;ng baggy, d&aacute;ng boyfriend rộng r&atilde;i. Nếu bạn vẫn chưa từ bỏ được giấc mơ với những chiếc quần skinny, h&atilde;y nhớ chọn &aacute;o d&aacute;ng rộng mặc c&ugrave;ng. V&agrave; cuối c&ugrave;ng, một chiếc quần jeans cổ điển, d&aacute;ng đứng sẽ rất đẹp khi bạn đi c&ugrave;ng gi&agrave;y cao g&oacute;t.</span></p>\r\n', 'mix-do-jean-the-nao-dep-fashionable', 'vi', NULL, NULL, '1552385354', '1', '1', '1', '', '', '', '', '2', '1', '0', '2');
INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('4', 'Màu sắc nào sẽ thống trị làng mốt trong năm 2018?', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Nh&oacute;m l&agrave;m việc tại Học viện Sắc m&agrave;u thế giới Pantone đ&atilde; c&ocirc;ng bố những gam m&agrave;u sẽ l&ecirc;n ng&ocirc;i trong m&ugrave;a mốt năm 2018.</span></p>\r\n', '1', 'upload/img/news/t4.jpg', '<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>Ultra violet</strong>: Học viện Sắc m&agrave;u Pantone vừa c&ocirc;ng bố t&iacute;m đậm sẽ l&agrave; t&ocirc;ng m&agrave;u của năm 2018, l&agrave; gam m&agrave;u chủ đạo trong c&aacute;c mẫu thiết kế trang phục v&agrave;o m&ugrave;a mốt năm sau. Sắc t&iacute;m tượng trưng cho sự lạc quan, quyền lực. Ch&uacute;ng truyền tải th&ocirc;ng điệp độc đ&aacute;o, hướng về tương lai v&agrave; sẽ được c&aacute;c nh&agrave; mốt thế giới như Proenza Schouler, Victoria Beckham, Michael Kors ứng dụng trong bộ sưu tập xu&acirc;n h&egrave; 2018.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img src=\"http://bizweb.dktcdn.net/100/296/275/files/12.jpg?v=1522168439037\" style=\"width:60%\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>Lavender pink:</strong>&nbsp;Hồng lavender l&agrave; gam m&agrave;u nhẹ nh&agrave;ng được pha trộn giữa hồng v&agrave; t&iacute;m tinh tế. Ch&uacute;ng mang đến vẻ mềm mại, l&atilde;ng mạn, dễ d&agrave;ng thu h&uacute;t sự ch&uacute; &yacute;. C&aacute;c thiết kế năm sau của nhiều nh&agrave; mốt thế giới sẽ thể hiện vẻ đẹp người phụ nữ ngọt ng&agrave;o như đ&oacute;a hoa lavender thơ mộng.&nbsp;</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img src=\"http://bizweb.dktcdn.net/100/296/275/files/21.jpg?v=1522168470114\" style=\"width:60%\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>Arcadia</strong>: Đ&acirc;y cũng m&agrave;u xanh l&aacute; c&acirc;y, nhưng được pha trộn với c&aacute;c sắc th&aacute;i kh&aacute;c nhằm thể hiện sự tươi m&aacute;t, trong trẻo hơn. M&agrave;u xanh lam trong bộ sưu tập từ thương hiệu Diane von Furstenberg sẽ đưa giới mộ điệu đến với kh&ocirc;ng gian ngập nắng của m&ugrave;a xu&acirc;n h&egrave; 2018.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img src=\"http://bizweb.dktcdn.net/100/296/275/files/34a-4e7c5ba1-ba0f-445f-90eb-95bcc88a7009.jpg?v=1522168573461\" style=\"width:60%\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>Sailor Blue:</strong>&nbsp;Năm 2018 tiếp tục trở th&agrave;nh cuộc đổ bộ của m&agrave;u xanh hải qu&acirc;n trong nhiều bộ sưu tập thời trang thế giới, điển h&igrave;nh như Fenty x Puma. Ch&uacute;ng mang đến cho ph&aacute;i nữ sự cổ điển nhưng vẫn kh&ocirc;ng k&eacute;m phần mạnh mẽ mỗi khi xuống phố.&nbsp;</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img src=\"http://bizweb.dktcdn.net/100/296/275/files/35a-083ee3a6-7fc1-46d7-b51d-45d72a75fe47.jpg?v=1522168774090\" style=\"width:60%\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>Tomato red:</strong>&nbsp;Đỏ c&agrave; chua l&agrave; sự pha trộn giữa m&agrave;u đỏ tươi v&agrave; t&ocirc;ng cam rực rỡ, c&oacute; khả năng truyền tải th&ocirc;ng điệp về l&ograve;ng can đảm v&agrave; quyết liệt mang đầy t&iacute;nh nữ quyền. C&aacute;c t&iacute;n đồ thời trang sẽ kh&ocirc;ng thể bỏ qua gam m&agrave;u n&agrave;y trong m&ugrave;a mốt năm sau.&nbsp;</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img src=\"http://bizweb.dktcdn.net/100/296/275/files/11-7491a248-d39f-42fc-bc1c-903da109218f.jpg?v=1522168955759\" style=\"width:60%\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\"><strong>Meadowlark:</strong>&nbsp;Nếu đang t&igrave;m kiếm một sắc m&agrave;u tươi mới cho m&ugrave;a xu&acirc;n năm sau, c&aacute;c t&iacute;n đồ thời trang kh&ocirc;ng n&ecirc;n đừng bỏ qua meadowlark - t&ocirc;ng v&agrave;ng chanh tươi s&aacute;ng v&agrave; nổi bật.</span></p>\r\n', 'mau-sac-nao-se-thong-tri-lang-mot-trong-nam-2018', 'vi', NULL, NULL, '1552385351', '1', '1', '1', '', '', '', '', NULL, '1', '0', '1');
INSERT INTO `news` (`id`, `title`, `description`, `hot`, `image`, `content`, `alias`, `lang`, `tag`, `time_update`, `time`, `category_id`, `home`, `focus`, `title_seo`, `keyword_seo`, `description_seo`, `video`, `view`, `active`, `button_1`, `sort`) VALUES ('5', 'Xu hướng thời trang đầm xòe kiểu mới', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Ra đời từ nhiều thập kỷ trước, đầm x&ograve;e vẫn chưa bao giờ hạ nhiệt v&agrave; hứa hẹn sẽ c&ograve;n &ldquo;chinh phạt&rdquo; khắp c&aacute;c s&agrave;n diễn thời trang lớn. Sự duy&ecirc;n d&aacute;ng, mềm mại, tạo bước đi uyển chuyển nhẹ nh&agrave;ng, bay bổng dường như l&agrave; sức h&uacute;t &ldquo;chết người&rdquo; của đầm x&ograve;e v&agrave; đ&atilde; chiếm trọn tr&aacute;i tim của ph&aacute;i đẹp. Với kiểu d&aacute;ng đặc trưng, những kiểu đầm x&ograve;e đẹp c&oacute; khả năng che khuyết điểm tuyệt vời. C&aacute;c c&ocirc; n&agrave;ng &ldquo;c&ograve; hương&rdquo; với v&ograve;ng 2 v&agrave; v&ograve;ng 3 mỏng mảnh, đến c&aacute;c &ldquo;b&eacute; bự&rdquo; với v&ograve;ng eo v&agrave; v&ograve;ng 3 hơi qu&aacute; khổ đều thoải m&aacute;i, tự tin với d&aacute;ng đầm x&ograve;e &ldquo;dễ t&iacute;nh&rdquo; n&agrave;y.</span></p>\r\n', '1', 'upload/img/news/t5.jpg', '<p style=\"text-align:justify\"><span style=\"font-size:14px\">Với c&aacute;c bạn g&aacute;i cao v&agrave; gầy, h&atilde;y chọn c&aacute;c d&aacute;ng đầm đẹp d&agrave;i qu&aacute; gối, m&agrave;u sắc tươi s&aacute;ng, độ &nbsp;đầm x&ograve;e hơi lớn gi&uacute;p l&agrave;m đầy v&ograve;ng eo mỏng v&agrave; v&ograve;ng 3 l&eacute;p. Ngo&agrave;i ra ch&uacute;ng c&ograve;n gi&uacute;p bạn che đ&ocirc;i ch&acirc;n nhỏ v&agrave; đầu gối củ lạc kh&aacute; hiệu quả. Đ&oacute; l&agrave; chưa kể đến những đ&ocirc;i ch&acirc;n cong, da ch&acirc;n thiếu mịn m&agrave;ng&hellip; bạn vẫn ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m khi kết hợp với đầm x&ograve;e. Với c&aacute;c n&agrave;ng hơi thừa c&acirc;n, m&agrave;u sắc trầm với họa tiết hoa nh&iacute;, thắt eo cao sẽ l&agrave; lựa chọn l&yacute; tưởng cho bạn. Bạn cũng n&ecirc;n nhớ độ đầm x&ograve;e vừa phải hoặc d&aacute;ng đầm su&ocirc;ng sẽ gi&uacute;p v&oacute;c d&aacute;ng thon gọn hơn.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img src=\"http://bizweb.dktcdn.net/100/296/275/files/22.jpg?v=1522168018038\" style=\"width:60%\" /></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">Nếu như những chiếc đầm &ocirc;m body c&oacute; ưu điểm t&ocirc;n l&ecirc;n đường cong c&ugrave;ng số đo ấn tượng của cơ thể th&igrave; những chiếc v&aacute;y d&aacute;ng x&ograve;e sẽ &ldquo;cứu c&aacute;nh&rdquo; cho những bạn g&aacute;i c&oacute; v&ograve;ng 3 nhỏ b&eacute;. Khi ra phố, đến cơ quan, đ&acirc;u đ&acirc;u cũng bắt gặp những chiếc đầm x&ograve;e đa m&agrave;u sắc, kiểu c&aacute;ch. Từ những c&ocirc; bạn teen cho tới giới trẻ, thậm ch&iacute; giới văn ph&ograve;ng cũng ưa chuộng kiểu đầm thoải m&aacute;i m&agrave; xinh đẹp n&agrave;y.</span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\"><img src=\"http://bizweb.dktcdn.net/100/296/275/files/1.jpg?v=1522168076993\" style=\"width:60%\" /></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:14px\">&nbsp;Thật đẹp v&agrave; tự tin khi sở hữu chiếc v&aacute;y chất lượng trong những bữa tiệc hay tại cơ quan. Thiết kế eo m&agrave;u tối gi&uacute;p cho bạn nữ c&oacute; th&acirc;n h&igrave;nh đậm tr&ocirc;ng thon thả hơn. Kiểu d&aacute;ng v&aacute;y x&ograve;e c&ugrave;ng họa tiết nơ ch&eacute;o mang lại sự trẻ trung cho nữ giới. Những bộ c&aacute;nh x&ograve;e được thiết kế với nhiều kiểu c&aacute;ch, chất liệu đa dạng từ đơn giản đến họa tiết trang tr&iacute;, hay những đi&ecirc;m nhấn l&agrave;m nổi bật vẻ nữ tr&iacute;nh v&agrave; trẻ trung.</span></p>\r\n', 'xu-huong-thoi-trang-dam-xoe-kieu-moi', 'vi', NULL, NULL, '1555142889', '1', '1', '1', '', '', '', '', '5', '1', '0', '3');
