INSERT INTO `staticpage` (`id`, `name`, `alias`, `description`, `content`, `image`, `lang`, `home`, `hot`, `focus`, `contact_page`, `title_seo`, `keyword_seo`, `description_seo`, `parent_id`, `page_footer`) VALUES ('31', 'Giới Thiệu', 'gioi-thieu', '<p>After 30 years Marc Jacobs continues to unabashedly shape the boundaries of American fashion. The indefinable characteristics of his namesake label are the result of a certain unique, uncommonly frank and brilliantly outspoken perspective.&nbsp;<br />\r\nMarc continues to explore the beauty in the unexpected and convey the luxury that exists in the everyday. At the core of the company&rsquo;s values is his belief that we are each the star of our own movie, and through the joy of the ritual of fashion, makeup and fragrance, we can help further define our individuality and personality.&nbsp;<br />\r\nMarc Jacobs continues to offer fashion and accessories through a broad spectrum of accessibility without compromising honesty and integrity.</p>\r\n', '', 'upload/img/pages/pro_1.png', 'vi', '1', '1', NULL, '0', '', '', '', '0', '1');
